    <title>Sovetnik Storage</title>
<style type="text/css"></style></head>
<body>
<script type="text/javascript">
    var storageScriptUrl = 'js/storage.min.js',
            versionPath = '?version=0';

    var params = location.href.substr(location.href.indexOf('?') + 1).split('&');
    for (var i=0; i<params.length; i++) {
        if (params[i].indexOf('version') === 0) {
            versionPath = '?' + params[i];
            break;
        }
    }

    var script = document.createElement('script');
    script.src = storageScriptUrl + versionPath;
    script.async = false;
    document.body.appendChild(script);

</script><script src="./storage.min.js.Без названия"></script>
